import {useState, useEffect, Fragment} from 'react'
import axios from 'axios';
import TableHeaders from './TableHeaders';
import TableData from './TableData';
import loading from '../styles/loading.gif'

const DUMMY_DATA = [
  {
    name: 'Aditya',
    rollNo:3,
    mas:3
  },
  {
    name: 'Prinnce',
    rollNo:6,
    mas:3
  },
  {
    name: 'ditya',
    rollNo:9,
    mas:3
  },
  {
    name: 'afsdf',
    rollNo:90,
    mas:3
  }
]

export default function Main() {
  const [headers, setHeaders] = useState([]);
  const [rowsData, setRowsData] = useState([]);
  const [loadingState, setLoadingState] = useState(true);

  useEffect(()=>{
    const getData = async () => {
      const response = await axios.get('/data');

      let data = response.data.data;

      let h = [];
      for(let header in data[0]){
        h.push(header);
      }

      setHeaders(h);
      setRowsData(data);
      setLoadingState(false);
    }

    getData();
  },[])

  // let h = [];
  // for(let header in DUMMY_DATA[0]){
  //   h.push(header);
  // }

  return (
    <div className='p-10 w-full bg-[#253647]'>
      <div className='bg-white rounded-xl'>
          <TableHeaders data={headers}></TableHeaders>
          <TableData headers={headers} data={rowsData}></TableData>
      </div>
    </div>
  )
}
